function generateSubmissionId() {
    const randomPart = Math.floor(Math.random() * 9000000000 + 1000000000)
    return `trn:oid:::1:${randomPart}`
}

function formatTurnitinDate(date: Date, timeZone = 'America/Los_Angeles') {
    return date.toLocaleString('en-US', {
        year: 'numeric',
        month: 'short',
        day: '2-digit',
        hour: 'numeric',
        minute: '2-digit',
        hour12: true,
        timeZone,
        timeZoneName: 'short'
    })
}

